import weatherGIF from './pics/weatherGIF.gif'
import techDecor from './pics/tech_decor.png'
import {Tabs} from './HomePage'

const GridContainer = () =>{
  return(
    <div className="flex-container">
      {Array.from({ length: 4 }).map((_, idx) => (
        <div key={idx} className="flex-item">
          Phonebook
        </div>
      ))}
    </div>
  )
} 




const ProjectsPage = () => {

  return (
    <>
    <div className = 'background'>
      <div>
            <Tabs/> 
      </div> 
          <GridContainer/> 
    </div>     
   
</>
  )
  
}

export default ProjectsPage;


